import React, { useEffect, useState } from "react";
import { Link, useParams } from "react-router-dom";
import NavbarProfil from "../components/NavbarProfil";
import {Container } from "react-bootstrap";
import ReponseCrea from '../components/ReponseCrea'

const ReponsesInfos = () => {
  const { id , id_examen, id_question , type}= useParams(); 
  return (
    <div>
      
        <Container fluid className="contentContainer" style={{ backgroundColor: 'rgba(142, 202, 230, 0.34)', 
        minHeight: '100vh' , padding: '20px 0' }}>
            <ReponseCrea/>
        </Container>
    </div>
  )
}

export default ReponsesInfos
